import React from 'react';

function PracticeTodo(){
    const arr = [1,2,3,4,5];
  return(
    <div>
      <h2>Basic of React js</h2>
      {
        arr.map((val,i)=>{
          return(
            <div>
              <h2 key={i}>{val}</h2>
              </div>
          )
        })
      }
    </div>
  )
}

export default PracticeTodo
